        public MoveAction MoveComparator(int playerSum, int dealerUpCard, bool isSoft)
        {
            MoveAction response = MoveAction.Stand;

            //TODO Soft hand comparations..
            if (isSoft)
            {

            }

            else
            {
                if (WinChanceWhenStand(playerSum, dealerUpCard) > WinChanceWhenHit(playerSum, dealerUpCard, false))
                {
                    response = MoveAction.Stand; // stand
                }
                else
                {
                    if (WinChanceWhenDoubleDown(playerSum, dealerUpCard) > 0.505)
                    {
                        response = MoveAction.Double; // double
                    }
                    else
                    {
                        response = MoveAction.Hit; // hit
                    }
                }
            }
            return response;
        }

        public double ProbOf(int card)
        {
            return cardAmounts[card] / cardAmounts[0];
        }

        public double WinChanceWhenHit(int playerTotal, int dealerUpcard, bool AddStandChance)
        {
            double probability = 0;
            for (int i = 1; i < 11; i++)
                if (playerTotal + i < 22)
                    probability += ProbOf(i) * WinChanceWhenHit(playerTotal + i, dealerUpcard, true);

            if (AddStandChance == true) 
                probability += WinChanceWhenStand(playerTotal, dealerUpcard); 

            return probability;
        }
        
        public double WinChanceWhenStand(int playerTotal, int dealerUpcard)
        {
            if (playerTotal < 18)
                return 1 - (DealerProbOfGoal(dealerUpcard, 17) + DealerProbOfGoal(dealerUpcard, 18) + DealerProbOfGoal(dealerUpcard, 19) + DealerProbOfGoal(dealerUpcard, 20) + DealerProbOfGoal(dealerUpcard, 21));
            else if (playerTotal == 18)
                return 1 - (DealerProbOfGoal(dealerUpcard, 18) + DealerProbOfGoal(dealerUpcard, 19) + DealerProbOfGoal(dealerUpcard, 20) + DealerProbOfGoal(dealerUpcard, 21));
            else if (playerTotal == 19)
                return 1 - (DealerProbOfGoal(dealerUpcard, 19) + DealerProbOfGoal(dealerUpcard, 20) + DealerProbOfGoal(dealerUpcard, 21));
            else if (playerTotal == 20)
                return 1 - (DealerProbOfGoal(dealerUpcard, 20) + DealerProbOfGoal(dealerUpcard, 21));
            else if (playerTotal == 21)
                return 1 - DealerProbOfGoal(dealerUpcard, 21);
            else
                throw new ArgumentException("Player total > 21 !");
        }

        public double WinChanceWhenDoubleDown(int playerTotal, int dealerUpcard)
        {
            double probability = 0;

            for (int i = 1; i < 11; i++)
                if (playerTotal + i < 22)
                    probability += ProbOf(i) * WinChanceWhenStand(playerTotal + i, dealerUpcard);

            return probability;
        }

